2. Add the following JavaScript code to handle sorting:

```javascript
document.addEventListener('DOMContentLoaded', () => {
  const table = document.querySelector('[data-sortable]');
  const headers = table.querySelectorAll('th');
  let sortOrder = 'asc';
  let sortColumnIndex;

  const sortTable = (columnIndex) => {
    const rows = Array.from(table.rows).slice(1);
    const sortedRows = rows.sort((a, b) => {
      const aText = a.cells[columnIndex].innerText.toLowerCase();
      const bText = b.cells[columnIndex].innerText.toLowerCase();

      if (aText < bText) {
        return sortOrder === 'asc' ? -1 : 1;
      }
      if (aText > bText) {
        return sortOrder === 'asc' ? 1 : -1;
      }
      return 0;
    });

    table.tBodies[0].append(...sortedRows);
  };

  headers.forEach((header, index) => {
    header.addEventListener('click', () => {
      if (sortColumnIndex === index) {
        sortOrder = sortOrder === 'asc' ? 'desc' : 'asc';
      } else {
        sortOrder = 'asc';
      }
      sortColumnIndex = index;
      sortTable(index);
    });
  });
});
```

Now, when you click on the table headers, the table will be sorted alphanumerically based on the clicked column. The sorting order will toggle between ascending and descending with each click.

